import React from "react";
import { Avatar } from "@mui/material";
import LogoutIcon from "@mui/icons-material/Logout";
import { useDispatch } from "react-redux";
import { useNavigate } from "react-router-dom";
const Header = () => {
  const user = JSON.parse(localStorage.getItem("user"));
  console.log("user", user);

  const dispatch = useDispatch();
  const navigate = useNavigate();
  const logout = () => {
    dispatch({ type: "LOGOUT" });
    navigate("/");
  };
  return (
    <div className="flex bg-[#FFFFFF] items-center justify-between  h-[99px] w-full">
      <div className="flex items-center">
        {/* <img
          src="https://daotao.ptit.edu.vn/_next/static/images/ptit-logo-c5be62e95f69e6f8285d1fd2ee0688ca.png"
          alt=""
          className="mr-3 h-9"
        /> */}
        <h1 className="ml-5 text-lg font-bold text-red-600">
          {" "}
          Học Viện Công Nghệ Bưu Chính Viễn Thông
        </h1>
      </div>
      <div className="flex items-center mx-5 space-x-3">
        <Avatar
        //   src={user.data.avatar}
        //   alt={user.data.firstname.charAt(0)}
        //   sx={{ width: 24, height: 24 }}
        //   className="border-2 border-blue-600"
        />
        {/* <h1>{user.data.firstname.split(" ")[0]}</h1> */}
        <LogoutIcon
          onClick={logout}
          className="transition-all cursor-pointer hover:scale-125 "
        />
      </div>
    </div>
  );
};

export default Header;
